const Results = (props) =>{
    return(
        <h1>
            {props.results.cityName && <div>{props.results.cityName}</div>}
            {props.results.country && <div>{props.results.country}</div>}
            {props.results.temperature && <div>{props.results.temperature}</div>}
        </h1>

    );
};

export default Results;
